    false,nt"url": null,nt"notes": "This data set contains the results from
    monitoring in the St. Thomas East End Reserves (STEER) in St. Thomas, USVI, from
    January 2012 to November 2013. The monitoring was conducted by project partners
    at the University of the Virgin Islands, and was part of a larger project to conduct
    an integrated assessment of the STEER. The data set includes measurements of nitrate,
    nitrate, ammonium, urea, orthophosphate, dissolved inorganic nitrogen, dissolved
    organic nitrogen, total nitrogen, total phosphorus, orthophosphate, bulk sediment
    deposition, terrigenous, organic, and carbonate sediment fractions, and total suspended
    solids (TSS).",nt"license_title": null,nt"extras": [{ntt"key": "bbox-east-long",ntt"value":
